import React from 'react';
import './Component.css'

class CalendarDetailList extends React.Component{

    static defaultProps = {
        post_picture :'',
        post_user_name :'',
        post_date : '',
        post_contents:''
    }
    render(){
        return(
            <div className="calendar_list_box">
                <div className="calendar_user_pic">
                        
                </div>
                <div className="calendar_list_txt_box">
                    <div className="calendar_user_box">
                        <div className="calendar_user_name">{this.props.post_user_name}</div>
                        <div className="calendar_post_contents">{this.props.post_contents}</div>
                    </div>
                </div>
            </div>
    
        );
    }
    
}
export default CalendarDetailList;
